import './App.css';
import Navbar from './assets/components/Navbar';
import Home from './assets/main/Home';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';

const router = createBrowserRouter([
  {path: '/', element: <Home />}
]);

function App() {
  return (
    <>
     <Navbar />
     <RouterProvider route="router" />
    </>
  );
}

export default App;
